import React from 'react';

function PatientDashboard({ user }) {
  console.log('PatientDashboard user:', user); // Debug: ตรวจสอบ prop user
  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-100 via-white to-blue-200 p-6">
      <h1 className="text-3xl font-bold text-gray-800 mb-6">Welcome, {user.fullName || user.username}!</h1>
      <p className="text-gray-600 mb-4">Patient Dashboard - ID: {user.patientId}</p>

      <div className="bg-white p-4 rounded-lg shadow-md">
        <h2 className="text-xl font-semibold text-gray-700 mb-2">Your Information</h2>
        <p><strong>Username:</strong> {user.username}</p>
        <p><strong>Full Name:</strong> {user.fullName || 'Not provided'}</p>
        <p><strong>Patient ID:</strong> {user.patientId}</p>
        <p><strong>Role:</strong> {user.role}</p> {/* เพิ่มแสดง role */}
      </div>

      <button
        className="mt-4 bg-blue-600 text-white py-2 px-4 rounded-lg hover:bg-blue-700"
        onClick={() => alert('View appointments feature coming soon!')}
      >
        View Appointments
      </button>
    </div>
  );
}

export default PatientDashboard;
